import React from 'react'
import { Routes, Route } from 'react-router-dom'

import HomePage from './routes/HomePage'
import Pricing from './routes/Pricing'

function App() {
	return (
		<Routes>
			<Route path='/' element={<HomePage />} />
			<Route path='/pricing' element={<Pricing />} />
		</Routes>
	)
}

export default App
